# Name:        module1
# Purpose: Given integers L and t, a string Pattern forms an (L, t)-clump inside a (larger) string Genome if there is an interval of Genome of length L in which Pattern appears at least t times. For example, TGCA  forms a (25,3)-clump in the following Genome: gatcagcataagggtcccTGCAaTGCAtgacaagccTGCAgttgttttac .

# Find patterns forming clumps in a string.
# Given: A string Genome, and integers k, L, and t.
# Return: All distinct k-mers forming (L, t)-clumps in Genome.
#
# Author:      feunteuny
#
# Created:     27/07/2015
# Copyright:   (c) feunteuny 2015
# Licence:     <your licence>
#-------------------------------------------------------------------------------

from patternMatchingProblem import patternMatching


def clumpFinding(genome, k, L, t):

    genomeLen = len(genome)
    ltClumps = set()

    for i in range(genomeLen - L):
        for j in range(i, i+L-k):
            if len(patternMatching(genome[j:j+k], genome[i:i+L])) >= t:
                ltClumps.add(genome[j:j+k])

    return ltClumps



def main():
    genome = ""



    L = 486
    k = 12
    t = 19

    print(' '.join(clumpFinding(genome, k, L, t)))

if __name__ == '__main__':
    main()
